import React from 'react'
import Footer from '../components/Footer'
import Header from '../components/Header'
import '../css/styles.css'

const Layout = ({ children }) => {
    return (
        <div>
            <Header />
            <div className="container mx-auto">
                {children}
            </div>
            <Footer />
        </div>
    )
}

export default MyApp
